import React from 'react';
import Requests from './requests';
import Sid from '../../layout/Sidebar/Sidebar'
import './pending.css'
import { Sidebar } from 'react-bootstrap';
const Pending = () => {

    return (
        <div>
            <Sidebar>
            <Sid />
             </Sidebar> 
            
            <Requests />

        </div>
    )
}

export default Pending ;
